-- Table structure for cms_inout_type_enum
-- ----------------------------
DROP TABLE IF EXISTS `cms_inout_type_enum`;
CREATE TABLE `cms_inout_type_enum` (
  `id` int(11) NOT NULL COMMENT '编号',
  `name` varchar(20) DEFAULT NULL COMMENT '名称',
  `note` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='情报板出入屏方式枚举\r\n\r\n编号	ITPserver	入库接口\r\n1	立即显示	随机\r\n2	上移	立即显示\r\n3	下移	上展\r\n4	左移	下展\r\n5	右移	左展\r\n6	横百叶窗	右展\r\n7	竖百叶窗	上移\r\n8	上下合拢	下移\r\n9	上下展开	左移\r\n10	左右合拢	右移\r\n11	左右展开	上下合拢\r\n12	中心合拢	上下展开\r\n13	中心展开	左右合拢\r\n14	向下马赛克	左右展开\r\n15	向右马赛克	横百叶窗\r\n16	淡入	竖百叶窗\r\n17	淡 出	左右对进\r\n18	字符闪烁（闪后消失）	上下对进\r\n19	字符闪烁（闪后停留）	中心合拢\r\n20	区域闪烁（闪后复原）	中心展开\r\n21	区域闪烁（闪后区域为黑）	向下马赛克\r\n22		向右马赛克\r\n23		淡入\r\n		\r\n';

-- ----------------------------
-- Records of cms_inout_type_enum
-- ----------------------------

