  `yellow_fre` int(11) DEFAULT NULL COMMENT '黄灯频率,0: 关闭，1: 常亮，2: 30次/分钟，3: 60次/分钟，4: 120次/分钟',
  `yellow_bri` int(11) DEFAULT NULL COMMENT '黄灯亮度,0: 当前为关闭，亮度值1-10',
  `visibility` double(11,0) DEFAULT NULL COMMENT '能见度',
  `wake_duration` int(11) DEFAULT NULL COMMENT '红灯为尾迹时的持续时间,单位/秒',
  `vehicle_check_using` int(11) DEFAULT NULL COMMENT '车检器是否开启，0为否，1为是。当车检器开启并且红灯不是关闭状态时，红灯为车辆尾迹显示状态',
  `red_mode` int(11) DEFAULT NULL COMMENT '红灯状态，0为普通，1为车辆尾迹',
  `equipment_time` int(11) DEFAULT NULL COMMENT '采集时间，时间戳（秒）',
  `equipment_id` varchar(36) DEFAULT NULL COMMENT '设备编号',
  `time` int(11) DEFAULT NULL COMMENT '入库时间',
  `equipment_name` varchar(20) DEFAULT NULL COMMENT '设备名称',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='雾灯系统采集数据';

