  `fun_type_id` int(11) DEFAULT NULL COMMENT '功能类型编号',
  `position_type_id` int(11) DEFAULT NULL COMMENT '位置类型编号',
  `parent_id` int(11) DEFAULT NULL COMMENT '上级菜单编号。为空则表示为首层菜单/导航',
  `parent_list` varchar(255) DEFAULT NULL COMMENT '亲族链。',
  `leaf` tinyint(4) DEFAULT NULL COMMENT '是否是叶子节点。1为叶子节点。0为非叶子节点',
  `icon` varchar(255) DEFAULT NULL COMMENT '图标。为空则无图标',
  `order` int(11) DEFAULT NULL COMMENT '顺序。同层的排列顺序。从0开始',
  `user_token` tinyint(4) DEFAULT NULL COMMENT '是否需要用户令牌。1表示需要，0表示不需要',
  `note` varchar(255) DEFAULT NULL COMMENT '备注',
  `depth` int(11) DEFAULT NULL COMMENT '深度',
  `extra_id` int(11) DEFAULT NULL COMMENT '扩展字段',
  `extra` varchar(255) DEFAULT NULL COMMENT '扩展字段',
  `page_id` int(11) DEFAULT NULL COMMENT '页面编号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=307 DEFAULT CHARSET=utf8 COMMENT='菜单';

