  `constructUnit` varchar(50) DEFAULT NULL COMMENT '施工单位',
  `manageUnit` varchar(50) DEFAULT NULL COMMENT '管养单位',
  `extPassWayNum` int(11) DEFAULT NULL COMMENT '安全通道数量',
  `isRamp` varchar(36) DEFAULT NULL COMMENT '是否匝道结构',
  `tunnelHole` varchar(50) DEFAULT NULL COMMENT '洞口',
  `tunnelPortal` varchar(255) DEFAULT NULL COMMENT '洞门',
  `pavement` varchar(255) DEFAULT NULL COMMENT '路面',
  `inspectionLane` varchar(255) DEFAULT NULL COMMENT '检修道',
  `drainageSystem` varchar(255) DEFAULT NULL COMMENT '排水系统',
  `suspendedCeiling` varchar(255) DEFAULT NULL COMMENT '吊顶',
  `completionDate` date DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='隧道';

