DROP TABLE IF EXISTS `visibility_detector_hourly_data`;
CREATE TABLE `visibility_detector_hourly_data` (
  `id` varchar(36) NOT NULL COMMENT '编号',
  `equipment_id` varchar(36) DEFAULT NULL COMMENT '设备编号',
  `visibility` double DEFAULT NULL COMMENT '能见度。数值范围10-2000,单位:米\r\n            ',
  `ground_temperature_1` double DEFAULT NULL COMMENT '地表温度1',
  `ground_temperature_2` double DEFAULT NULL COMMENT '地表温度2',
  `road_status` int(11) DEFAULT NULL COMMENT '路面状态。1=干燥，2=潮湿，3=多雨，4=冰冻，5=霜/雪，6=残盐，7=冰雨\r\n（数值范围0-99 0=err，1=干燥，2=微湿，3=潮湿,4=多水, 5=残留盐, 6=雪，7=冰,9=雨雪。弃用）',
  `rain` double DEFAULT NULL COMMENT '雨量。0无雨,单位mm',
  `wind_speed` double DEFAULT NULL COMMENT '风速。数值范围0-60,单位m/s',
  `wind_direction` int(11) DEFAULT NULL COMMENT '风向。数值范围0-359,单位度\r\n            ',
  `air_temperature` double DEFAULT NULL COMMENT '空气温度。数值范围0-1000,表示-40至59.9摄氏度',
  `air_humidity` double DEFAULT NULL COMMENT '空气湿度。数值范围0-1000,表示0-99.9,单位RH%',
  `equipment_time` int(11) DEFAULT NULL COMMENT '设备时间',
  `time` int(11) DEFAULT NULL COMMENT '入库时间',
  `level` int(11) DEFAULT NULL COMMENT '等级',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='气象仪小时数据表';

-- ----------------------------
-- Records of visibility_detector_hourly_data
-- ----------------------------

