-- ----------------------------
-- View structure for gjvalue_view
-- ----------------------------
DROP VIEW IF EXISTS `gjvalue_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `gjvalue_view` AS select `element`.`id` AS `id`,`element`.`name` AS `eqName`,`map`.`id` AS `mapId`,`map`.`name` AS `mapName`,`real_element`.`up_direction` AS `up_direction`,`plc_yc_history_data`.`time` AS `time`,`plc_yc_history_data`.`value` AS `value` from (((((`element` join `map` on((`map`.`id` = `element`.`map_id`))) join `equipment` on((`equipment`.`id` = `element`.`id`))) join `real_element` on((`real_element`.`id` = `element`.`id`))) left join `plc_yc_instant_link` on((`plc_yc_instant_link`.`element_id` = `element`.`id`))) left join `plc_yc_history_data` on((`plc_yc_instant_link`.`history_id` = `plc_yc_history_data`.`id`))) where (`element`.`element_type_id` = 'P_GJ') ;

