-- ----------------------------
-- Function structure for fun
-- ----------------------------
DROP FUNCTION IF EXISTS `fun`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `fun`(`stake` varchar(255)) RETURNS int(11)
BEGIN
   DECLARE vResult INT DEFAULT 1;
   DECLARE vtempstr1 VARCHAR(50) DEFAULT '';
   DECLARE vtempstr2 VARCHAR(50) DEFAULT '';
    set vtempstr1=stake;
    if  instr(vtempstr1,'+')=0 and instr(vtempstr1,'K')=0 
     then
   set vtempstr2=vtempstr1;
    end if;
  if  instr(vtempstr1,'+')=0 then
   set vtempstr2 =substr(vtempstr1,instr(vtempstr1,'K')+1);
    end if;

   if instr(vtempstr1,'+')<>0 then
     set vtempstr2=replace(substr(vtempstr1,instr(vtempstr1,'K')+1),'+','');
    end if;
  
  set vResult=CONVERT(vtempstr2,SIGNED);
	RETURN vResult;
end
;;
DELIMITER ;

